canonical_solution:
class Solution:
    def searchMatrix(self, matrix: List[List[int]], target: int) -> bool:
        m, n = len(matrix), len(matrix[0])
        left, right = 0, m * n - 1
        while left < right:
            mid = (left + right) >> 1
            x, y = divmod(mid, n)
            if matrix[x][y] >= target:
                right = mid
            else:
                left = mid + 1
        return matrix[left // n][left % n] == target

inefficient_solution:
class Solution:
    def searchMatrix(self, matrix: List[List[int]], target: int) -> bool:
        m, n = len(matrix), len(matrix[0])
        total_elements = m * n

        # Create a list of all elements in the matrix
        all_elements = []
        for row in matrix:
            all_elements.extend(row)

        # Create a list of indices for each element in the matrix
        indices = []
        for i in range(total_elements):
            indices.append([i // n, i % n])

        # Iterate over all elements in the matrix
        for i in range(total_elements):
            # Check if the current element is equal to the target
            if all_elements[i] == target:
                return True

        # If the target is not found
        return False
